from spe.univers import coterie
from abs.humanite import metier
from abs.humanite import trait
from abs.univers.geographie import quartier
import random

class Zaporogues(coterie.Coterie):

    NOM = u"Zaporogues"
    ID = u"zaporogues"

    def __init__(self):
        self.nom_ = Zaporogues.NOM
        self.id_ = Zaporogues.ID
        self.quartier_ = quartier.Suresnes.NOM

    def getLabelUniversite(self):
        return "univZaporogues"

    def GetTraitsCompatibles(self):
        """
        si le perso a ces caracs il a plus de chances de vouloir rejoindre cette coterie
        """
        return [ \
            trait.Assurance.NOM, \
            trait.Artiste.NOM, \
            trait.Spiritualite.NOM, \
            trait.Observation.NOM, \
            trait.Sensibilite.NOM, \
            trait.Constitution.NOM, \
            trait.Franchise.NOM, \
            ]

    def GetTraitsIncompatibles(self):
        """
        si le perso a ces caracs il a moins de chances de ne pas vouloir rejoindre cette coterie
        """
        return [ \
            trait.Poids.NOM, \
            trait.Cupidite.NOM, \
            trait.Industrie.NOM, \
            trait.Intellectualisme.NOM, \
            trait.Ambition.NOM, \
            trait.Prudence.NOM, \
            ]

    def GetMetiersCompatibles(self):
        """
        si le perso a des compétences dans ces métiers il a plus de chances de vouloir rejoindre cette coterie où ils sont souvent pratiqués
        """
        return [ \
            metier.Danseur.NOM, \
            metier.Acteur.NOM, \
            metier.Marchand.NOM, \
            metier.Poete.NOM, \
            metier.Pretre.NOM, \
            metier.TueurDeMonstres.NOM, \
            metier.Parasite.NOM, \
            metier.Guerrier.NOM, \
            metier.Chauffeur.NOM, \
            metier.Aventurier.NOM, \
            metier.Chasseur.NOM, \
            ]

    def GetGentile(self, masculin):
        if masculin:
            return "zaporogue"
        else:
            return "zaporogue"

    def GetPoidsDemo(self):
        """
        à quel point cette coterie est nombreuse dans la population
        2.0 = très gross coterie
        1.0 = normal
        0.1 = 10 fois moins que la moyenne
        """
        return 2.8

    def nomTribu(self):
        return "{}".format(random.choice(Zaporogues.TRIBUS))

    def CreerNom(self, masculin):
        """
        génère un patronyme correspondant à la coterie en question
        """
        if masculin:
            return "{} {}".format(random.choice(Zaporogues.PRENOMS_M_2), random.choice(Zaporogues.NOMS_M))
        else:
            return "{} {}".format(random.choice(Zaporogues.PRENOMS_F_2), random.choice(Zaporogues.NOMS_F))

    def CreerPrenom(self, masculin):
        """
        génère un patronyme correspondant à la coterie en question
        """
        if masculin:
            return random.choice(Zaporogues.PRENOMS_M_1)
        else:
            return random.choice(Zaporogues.PRENOMS_F_1)

    def GenererPortraits(self, age, masculin, metObj, portraits, valeursTraits):
        """
        ajoute des portraits correspondants aux caracs en paramètre (et à la coterie courante)
        """
        if masculin:
            if age <= 35:
                if metObj is not None and metObj.nom_ == metier.Chasseur.NOM:
                    portraits.append("images/coteries/zaporogues/portraits/15-35_chasseur.jpg")
            if age >= 20:
                if age >= 25:
                    if age >= 30:
                        if age >= 40:
                            if age >= 45:
                                if age >= 50:
                                    if age >= 65:
                                        portraits.append("images/coteries/zaporogues/portraits/65+.jpg")
                                    portraits.append("images/coteries/zaporogues/portraits/50+.jpg")
                                    portraits.append("images/coteries/zaporogues/portraits/50+_2.jpg")
                                if age <= 70:
                                    portraits.append("images/coteries/zaporogues/portraits/45-70.jpg")
                            if age <= 60:
                                portraits.append("images/coteries/zaporogues/portraits/40-60.jpg")
                        if age <= 60:
                            portraits.append("images/coteries/zaporogues/portraits/30-60.jpg")
                            portraits.append("images/coteries/zaporogues/portraits/30-60_2.jpg")
                            if metObj is not None and metObj.nom_ == metier.Musicien.NOM:
                                portraits.append("images/coteries/zaporogues/portraits/30-60_musicien.jpg")
                    if age <= 50:
                        portraits.append("images/coteries/zaporogues/portraits/25-50.jpg")
                        portraits.append("images/coteries/zaporogues/portraits/25-50_2.jpg")
                    if metObj is not None and metObj.nom_ == metier.Guerrier.NOM:
                        portraits.append("images/coteries/zaporogues/portraits/25-50_guerrier.jpg")
                if age <= 45:
                    portraits.append("images/coteries/zaporogues/portraits/20-45.jpg")
                    portraits.append("images/coteries/zaporogues/portraits/20-45_2.jpg")
                    portraits.append("images/coteries/zaporogues/portraits/20-45_3.jpg")
        else:
            if age >= 15:
                if age >= 20:
                    if age >= 30:
                        if age >= 50:
                            portraits.append("images/coteries/zaporogues/portraits/F50+.jpg")
                        if age <= 60:
                            portraits.append("images/coteries/zaporogues/portraits/F30-60.jpg")
                    if age <= 40:
                        portraits.append("images/coteries/zaporogues/portraits/F20-40.jpg")
                        if metObj is not None and metObj.nom_ == metier.Berger.NOM:
                            portraits.append("images/coteries/zaporogues/portraits/F20-40_bergere.jpg")
                        if metObj is not None and metObj.nom_ == metier.Paysan.NOM:
                            portraits.append("images/coteries/zaporogues/portraits/F20-40_paysane.jpg")
                if age <= 35:
                    portraits.append("images/coteries/zaporogues/portraits/F15-35.jpg")

        return portraits

